function NetworkReport(props){
    console.log(props);
    return <div>
        <b>{props.name}:</b><br/>
        <ul>
            {props.IPv4.map((data, idx)=>{
                return <li key={idx}>{data.IP}</li>
            })}
            <li>{props.IPv4[0].IP}</li>
        </ul>
    </div>
}
export default NetworkReport;
